import React from 'react';
import LoginForm from '../components/LoginForm';
import '../styles/Login.css'

const Login = () => {
  const handleLogin = (email, password) => {
    // Add your login logic here
    console.log('Logging in with:', email, password);
  };

  const handleRegisterRedirect = () => {
    // Add redirection logic to registration page
    console.log('Redirecting to registration page');
  };

  return (
    <div className='two-half-container'>
      <div className='left-side'>
        <img src="https://files.insby.tech/test/static/login_image.png"  />
      </div>
      <div className='right-side' >
        {/* Right side (login form) */}
        <LoginForm onLogin={handleLogin} onRegisterRedirect={handleRegisterRedirect} />
      </div>
    </div>
  );
};

export default Login;
